INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 105, 0, 1.5, 0, 122601, 110, 1, 160, 1, 101, 0.029, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 111, 1, 2.5, 0, 122401, 105, 3, 120, 2, 102, 0.014, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 2);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, 0, 2.5, 1, 122501, 110, 2, 350, 3, 103, 0.017, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 3);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, 1, 1.5, 0, 107501, 110, 3, 130, 4, 104, 0.016, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 4);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 105, 0, 2.5, 0, 107601, 110, 1, 160, 5, 105, 0.014, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 5);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 103, 0, 3.5, 1, 107801, 120, 2, 255, 6, 106, 0.029, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 6);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 103, 0, 3.5, 0, 110601, 120, 1, 160, 7, 107, 0.013, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 7);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 103, 0, 2.5, 1, 110401, 110, 2, 350, 8, 108, 0.014, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 8);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 100, 1, 1.5, 0, 110501, 105, 3, 130, 9, 109, 0.012, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 9);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 103, 0, 2.5, 0, 115701, 105, 1, 200, 10, 110, 0.014, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 10);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 103, 0, 2.5, 1, 113601, 105, 2, 350, 11, 111, 0.071, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 11);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 103, 1, 1.5, 0, 107901, 120, 3, 130, 12, 112, 0.014, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 12);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 105, 0, 1.5, 0, 108001, 110, 2, 200, 13, 113, 0.022, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 13);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 108, 0, 2.5, 0, 110301, 110, 1, 160, 14, 114, 0.031, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 14);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, 1, 0.5, 0, 107701, 110, 1, 130, 15, 115, 0.036, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 15);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 95, 0, 3.5, 1, 113101, 110, 2, 350, 16, 116, 0.048, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 16);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, 1, 1.5, 0, 113301, 105, 3, 130, 17, 117, 0.043, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 17);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 95, 1, 1.5, 0, 113201, 105, 2, 130, 18, 118, 0.018, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 18);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 108, 0, 2.5, 0, 117001, 110, 2, 160, 19, 119, 0.021, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 19);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, 0, 2.5, 1, 113501, 110, 1, 255, 20, 120, 0.036, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 20);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, 0, 2.5, 1, 113401, 105, 3, 350, 21, 121, 0.02, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 21);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, 1, 2.5, 0, 110101, 110, 1, 130, 22, 122, 0.018, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 22);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 111, 0, 3.5, 0, 110001, 105, 3, 160, 23, 123, 0.03, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 23);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 103, 1, 1.5, 0, 117201, 110, 1, 130, 24, 124, 0.027, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 24);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 108, 0, 3.5, 0, 117301, 105, 2, 160, 25, 125, 0.02, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 25);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, 0, 2.5, 1, 117401, 110, 3, 350, 26, 126, 0.04, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 26);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, 0, 3.5, 1, 117101, 110, 1, 350, 27, 127, 0.009, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 27);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, 0, 3.5, 1, 122901, 120, 1, 255, 28, 128, 0.022, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 28);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0, 105, 1, 2.5, 0, 122801, 110, 3, 130, 29, 129, 0.028, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 29);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (1, 108, 0, 3.5, 0, 122701, 105, 2, 130, 30, 130, 0.023, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 30);
